from kaggle_environments.envs.hungry_geese.hungry_geese \
    import Observation, Configuration, Action, translate, row_col
import random
import torch
import torch.nn as nn
import torch.nn.functional as F


class GooseNet4(nn.Module):
    def __init__(self):
        n_channels = 12
        super(GooseNet4, self).__init__()
        self.conv1 = nn.Conv2d(in_channels=12, out_channels=n_channels,
                               kernel_size=3, padding=(1, 1), padding_mode='circular')
        self.conv2 = nn.Conv2d(in_channels=n_channels, out_channels=2 * n_channels,
                               kernel_size=3, padding=(1, 1), padding_mode='circular')
        self.conv3 = nn.Conv2d(in_channels=2*n_channels, out_channels=4 * n_channels,
                               kernel_size=3, padding=(1, 1), padding_mode='circular')
        self.final_conv = nn.Conv2d(in_channels=4 * n_channels, out_channels=1,
                                    kernel_size=5, padding=0)

    def forward(self, x):
        x = F.relu(self.conv1(x))
        x = F.relu(self.conv2(x))
        x = F.relu(self.conv3(x))
        north = x[:, :, 0:5, 3:8]
        east = torch.rot90(x[:, :, 1:6, 4:9], 1, [2, 3])
        south = torch.rot90(x[:, :, 2:7, 3:8], 2, [2, 3])
        west = torch.rot90(x[:, :, 1:6, 2:7], 3, [2, 3])

        # т.к. выходной вектор сети имеет форму [batch_size,1,1,4] - число батчей, число каналов, высота, ширина
        # (последний слой - это сверточная сеть, тут не очень очевидно с выходом, может добавить линейный слой?)
        # убираем лишние оси
        north = self.final_conv(north).squeeze(1).squeeze(2)
        east = self.final_conv(east).squeeze(1).squeeze(2)
        south = self.final_conv(south).squeeze(1).squeeze(2)
        west = self.final_conv(west).squeeze(1).squeeze(2)
        # Склеиваем все результаты в один батч
        return torch.cat([north, east, south, west], 1)

    def __str__(self):
        return "YarEstimator4Layer"


class AbstractAgent:

    def __init__(self, net, get_state, eps_greedy):
        self.n_actions = 4
        self.net = net
        if net is not None:
            self.net.eval()

        self.eps_greedy = eps_greedy
        self.get_state = get_state

    def __call__(self, observation: Observation, configuration):
        pass

    def get_action_index(self, observation: Observation, configuration: Configuration):
        action = self.__call__(observation, configuration)
        i = 0
        while i < self.n_actions:
            if action == Action(i + 1).name:
                return i
            i += 1


class SmartGoose(AbstractAgent):
    def __init__(self, net, get_state, eps_greedy):
        super().__init__(net=net,
                         get_state=get_state,
                         eps_greedy=eps_greedy)
        self.prev_observation = None
        self.eps = eps_greedy
        self.prev_action = Action(1)

    def __call__(self, observation,  configuration):
        self.net.eval()
        observation = Observation(observation)
        configuration = Configuration(configuration)
        action_index = self._get_not_bad_action(observation, configuration)
        self.prev_action = Action(action_index + 1)
        return Action(action_index + 1).name

    def _get_not_bad_action(self, observation: Observation, configuration: Configuration):
        """
        Choose save action (he neither commits suicide nor does kamikadze moves), but probably moves to positions
        that are adjacent to other goose heads.
        :param state:
        :return:
        """
        # Don't move into any bodies
        bodies = {position for goose in observation.geese for position in goose[:-1]}

        # Move to the closest food
        position = observation.geese[observation.index][0]
        bad_action_idx_list = [
            action.value - 1 for action in Action
            for new_position in [translate(position, action, configuration.columns, configuration.rows)]
            if (new_position in bodies or (action == self.prev_action.opposite()))]
        state = self.get_state(observation, self.prev_observation)
        q_values = self.net(state.unsqueeze(0)).squeeze()
        q_values[bad_action_idx_list] = -10000
        return int(q_values.max(0)[1])

    def _get_not_opposite_random_action(self):
        opposite_action = self.prev_action.opposite().value
        return random.choice([i for i in range(4) if i != opposite_action])


class AbstractFeatureTransform:
    FEATURES_CHANNELS_IN = 0
    FEATURES_HEIGHT = 0
    FEATURES_WIDTH = 0

    def __init__(self):
        ...

    @staticmethod
    def get_state(observation, prev_observation):
        ...

    @staticmethod
    def get_reward(observation, prev_observation):
        ...

    @staticmethod
    def adjust_action(observation: Observation, prev_observation: Observation, action: Action):
        return action


class YarFeatureTransform(AbstractFeatureTransform):
    FEATURES_CHANNELS_IN = 12
    FEATURES_HEIGHT = 7
    FEATURES_WIDTH = 11
    configuration = Configuration({"rows": 7, "columns": 11, 'hunger_rate': 40, 'episodeSteps': 200})

    @staticmethod
    def get_reward(observation: Observation, prev_observation: Observation):
        return get_yar_reward(observation, prev_observation, YarFeatureTransform.configuration)

    @staticmethod
    def get_state(observation: Observation, prev_observation: Observation):
        n_geese = len(observation.geese)
        prev_heads = [-1] * len(observation.geese)
        if prev_observation is not None:
            for i in range(n_geese):
                prev_heads[i] = prev_observation.geese[i][0] if len(prev_observation.geese[i]) != 0 else 1

        return get_features(observation, prev_heads, YarFeatureTransform.configuration)


def get_yar_reward(observation: Observation, prev_obs: Observation, configuration: Configuration):
    index = observation.index
    if len(observation.geese[index]) > len(prev_obs.geese[index]):
        return 1

    if len(observation.geese[index]) == 0:
        return -2

    return 0


def ids2locations(ids, prev_head, step, rows, columns):
    state = np.zeros((4, rows * columns))
    if len(ids) == 0:
        return state
    state[0, ids[0]] = 1  # goose head
    if len(ids) > 1:
        state[1, ids[1:-1]] = 1  # goose body
        state[2, ids[-1]] = 1  # goose tail
    if step != 0:
        state[3, prev_head] = 1  # goose head one step before
    return state


def get_features(observation: Observation, prev_heads, configuration: Configuration):
    rows, columns = configuration.rows, configuration.columns
    geese = observation.geese
    index = observation.index
    step = observation.step
    # convert indices to locations
    locations = np.zeros((len(geese), 4, rows * columns))
    for i, g in enumerate(geese):
        locations[i] = ids2locations(g, prev_heads[i], step, rows, columns)
    if index != 0:  # swap rows for player locations to be in first channel
        locations[[0, index]] = locations[[index, 0]]
    # put locations into features
    features = np.zeros((12, rows * columns))
    for k in range(4):
        # склеить все части тела для каждого гуся (кроме предыдущей головы)
        features[k] = np.sum(locations[k][:3], 0)
    # склеить соответствующие состояния всех гусей (либо головы всех, либо тело, либо хвосты, либо пред. головы)
    for k in range(4):
        features[k + 4] = np.sum(locations[:, k], 0)

    # только пред. голова наешего героя
    features[-5, :] = locations[index][3]

    features[-4, observation.food] = 1  # food channel
    features[-3, :] = (step % configuration.hunger_rate) / configuration.hunger_rate  # hunger danger channel
    features[-2, :] = step / configuration.episode_steps  # timesteps channel
    features[-1, :] = float((step + 1) % configuration.hunger_rate == 0)  # hunger milestone indicator
    features = torch.Tensor(features).reshape(-1, rows, columns)
    # roll
    if len(geese[index]) > 0:
        head_row, head_col = row_col(geese[index][0], columns)
    else:
        head_row, head_col = row_col(prev_heads[index], columns)

    features = torch.roll(features, ((rows // 2) - head_row, (columns // 2) - head_col), dims=(-2, -1))
    return features

net_str = b''
state_dict = pickle.loads(bz2.decompress(base64.b64decode(net_str)))
net = GooseNet4()
net.load_state_dict(state_dict)
agent = SmartGoose(net, YarFeatureTransform.get_state, 0)
configuration = Configuration({"rows": 7, "columns": 11, 'hunger_rate': 40, 'episodeSteps': 200})


def hero(observation):
    observation = Observation(observation)
    return agent(observation, configuration)


